import MotionHoc from "./MotionHoc";
import styled from "styled-components";

const Section = styled.div`
    width: 100%;
    text-align: center;
    color: white;

    a {
      color: white;
      margin: 10px;
      text-decoration: none;
    }
`;

const CalenderComponent = () => {
  return  <Section>
            <h1>Contact</h1>
            <a href="mailto:chriseriksen@hotmail.com"><p>chriseriksen@hotmail.com</p></a>
            <p><a href='facebook.com/Skov.music'>facebook.com/Skov.music</a></p>
            <p> instagram | <a href='https://www.instagram.com/chriseriksenmusic/?hl=en'>@chriseriksenmusic</a></p>
          </Section>;
};

const Calender = MotionHoc(CalenderComponent);

export default Calender;
